  `product_warranty` text CHARACTER SET utf8,
  `updatedon` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `desname` varchar(250) DEFAULT NULL,
  PRIMARY KEY (`product_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

